import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Contact() {
    return (<Container className="mt-5">
        <Row>
            <Col>
                <h2>Get in Touch Us</h2>

                <form>
                    <h2 ><b>Get in Touch</b></h2>
<span>
    <input/>
</span>

                </form>

            </Col>
        </Row>
    </Container>
    )

}
export default Contact;
